INSERT INTO `streunerkatzen_contentcomponent` (`ID`, `Content`) VALUES
(2, '<p>Tolle Contentbox</p>'),
(3, '<p>Verein zum Schutz verwilderter Katzen</p>'),
(4, '<p>Zweimal jährlich gibt es eine wahre \"Katzenbabyflut\". Tierfreunde, Tierschützer, aber leider auch unverantwortliche Menschen, die „einmal“ Junge haben wollten, versuchen dann die Babies an den Mann zu bringen.<br>Es wird aber von Jahr zu Jahr schwieriger die Kleinen unterzubringen und vor allem so unterzubringen, dass sie einen Platz auf Lebenszeit bekommen.</p><p>Je mehr Katzenbabies vermittelt werden müssen, desto leichtfertiger werden sie meist vermittelt.<span>&nbsp;</span><br>Oft werden die Tiere viel zu früh von Mutter und/oder Geschwistern getrennt, kommen in Einzelhaft in die Wohnung, etc.. Die Folgen sind:</p><p>- Aggression<br>- Zerstörungswut<br>- Ständiges Schreien<br>- Unrein sein</p><p>Über kurz oder lang müssen sie dann als erwachsene Tiere ein zu Hause finden, da die Besitzer oft mit der Situation überfordert sind und gar nicht den Willen haben sich zu informieren und das Problem an der Wurzel anzupacken. Die Katzen landen dann oft entweder im Tierheim oder bei Tierschutzvereinen. Die wiederum haben dann den Ruf nur „gestörte“ Tiere in der Vermittlung zu haben, was eine Vermittlung solcher Tiere nicht gerade fördert bzw. erleichtert.</p><p>Wenn sie nicht soviel Glück haben werden sie getötet oder ausgesetzt. Und so schließt sich der Kreis, denn die ausgesetzten Tiere sind oft noch nicht kastriert und bekommen bald selber Nachwuchs.<br>Oder sie entwischen während der Rolligkeit oder werden bewusst rausgelassen, weil sie so „nerven“ oder die Wohnung vollpinkeln.</p><p>Die Kastration von wilden Katzen, aber auch die Kastration der Katzen die in Privathaushalten leben, ist uns daher ein sehr wichtiges Anliegen. Die Katzenpopulationen vergrößern sich sonst immer mehr und mehr und es kommt nach einiger Zeit zu Inzucht und daraus resultierenden Krankheiten.</p>'),
(5, '<h4>Vor der Operation</h4><p>Die Katze sollte unbedingt frei von klinischen Krankheitssymptomen sein. In optimalen Fällen kennt der Tierarzt das Tier von vorangegangenen Untersuchungen im Rahmen von Impfungen und antiparasitären Behandlungen.<br>Unmittelbar vor der Operation darf die Katze nichts fressen, d.h. über einen Zeitraum von 12 Stunden kein Futter zu sich nehmen. Wasser trinken darf sie jedoch sehr wohl.</p><p>Ebenfalls günstiger für die Operationssituation ist, wenn die Katzen nicht gerade rollig ist (erhöhte Blutungsgefahr)<br>Eine Kastration ist natürlich trotzdem möglich. Bisher gab es bei unseren Katzen, welche bei der Kastration rollig waren, keinerlei Komplikationen.</p>'),
(6, '<p>Jetzt gibt es aber Menschen, die trotz allem unbedingt Katzenbabies von ihrer Katze haben müssen/wollen. Leider gibt es immer noch einige Irrtümer, die sich hartnäckig halten und mit denen wir oft konfrontiert werden:Jetzt gibt es aber Menschen, die trotz allem unbedingt Katzenbabies von ihrer Katze haben müssen/wollen. Leider gibt es immer noch einige Irrtümer, die sich hartnäckig halten und mit denen wir oft konfrontiert werden:</p><h4><br>Katzen sollten mind. einmal in ihrem Leben Babys bekommen z.B. weil es für die „Psyche“ und die Gesundheit der Katze gut ist, einmal geworfen zu haben.</h4><p>Dass Katzen einmal in ihrem Leben Junge bekommen sollen, ist ein weit verbreiteter Irrglaube. Viele der Katzenmütter sind mit ihrem ersten Wurf hoffnungslos überfordert und kümmern sich dann nicht um die Jungen. Diese sterben dann an Unterkühlung oder verhungern, sofern man sie nicht mit der Hand aufzieht. Hat man Glück und die meist viel zu junge Mami kümmert sich um ihre Babys, ist das nur ihrem angeborenen Instinkt zuzuschreiben und nicht weil sie so eine Freude mit ihren Babys hat. Leider gibt es auch immer wieder Tierärzte die den Katzenbesitzern raten, die Katze einmal werfen zu lassen, bevor sie kastriert wird, weil es besser für Eierstöcke und Gebärmutter ist. Nun bleibt die Frage, wieso sollte man etwas \"Gutes\" für Eierstöcke und Gebärmutter tun? Die Eierstöcke werden bei der Kastration entfernt und je nach Tierarzt oder medizinische Notwendigkeit auch die Gebärmutter. Was für einen Sinn hat das also?</p><h4><br>Unsere Kinder sollen einmal das „Wunder der Geburt“ erleben und zusehen können wie kleine Kätzchen aufwachsen und größer werden.</h4><p>Das „Wunder der Geburt“ läuft nicht immer ohne Komplikationen ab und es kommt nicht selten vor, dass manche Babys in den ersten 2 Wochen sterben oder gleich tot auf die Welt kommen. Sollte die Mutterkatze überfordert sein und sich nicht um ihre Jungen kümmern, heißt es: Handaufzucht der Kitten. Das hört sich allerdings süßer an, als es ist, da die Babys je nach Alter alle 2 – 4 Stunden ihre Flasche bekommen müssen, auch in der Nacht! Und es ist nicht gesagt, dass überhaupt alle Kitten überleben.Spätestens bei der Umstellung von Muttermilch auf feste Nahrung bekommen die meisten Jungtiere schlimmen Durchfall, da oft zu schnell und auf ungeeignete Futtermittel umgestellt wird.Falls die Kitten überleben, toben sie bald im Haus / in der Wohnung herum und eine kl. Horde spielender Kitten hat jede Menge Unsinn im Kopf. Oft sagen dann Interessenten die vorher unbedingt eines der Babys aufnehmen wollten kurzfristig ab und wohin dann mit den Kleinen?</p><h4><br>Eine Möglichkeit \"einmal Katzenbabys\" zu haben oder das Aufwachsen der Kleinen beobachten zu können.</h4><p>Informieren Sie sich ausführlich über Trächtigkeit, Geburt und Aufzucht und wenden Sie sich dann an einen Tierschutzverein oder Tierheim. Es gibt leider genug hochträchtige Katzen, die nicht mehr kastriert werden können und die ohnehin Nachwuchs bekommen. Tierschutzvereine und Tierheime würden durch Unterbringung solcher Katzen auf verantwortungsbewussten und verlässlichen Pflegeplätzen immens entlastet werden.</p><h4><br>Wir wollen unbedingt Nachwuchs von „unserer“ Katze, da diese ganz besonders hübsch ist oder ein ganz besonderes Wesen hat.</h4><p>Hierzu soll gesagt sein: für die meisten Katzenbesitzer ist die eigene Katze immer die hübscheste, schönste und hat sowieso DEN Charakter schlechthin. Das heißt aber nicht, dass sie diese Eigenschaften auch an ihren Nachwuchs weitervererbt. Unseren Beobachtungen zufolge haben die Kitten von normalen Hauskatzen meist gar nichts oder nur sehr wenig mit der Mutter gemeinsam.<br> Ein gutes Beispiel hierfür war unsere „Penelope“ sie wurde streunend und hochträchtig aufgegriffen. Penelope war eine sehr gelassene, ruhige, angenehme Katze, die durch nichts zu erschüttern war. Die hübsche Tigerkatze brachte dann einen roten Kater, eine schwarzes Mäderl und 2 dreifärbige Katzenmädchen zur Welt, die allesamt sehr aufgedreht und aufgeweckt waren und weder im Aussehen noch vom Charakter her auch nur annähernd Ähnlichkeiten mit Mutterkatze Penelope hatten. Derartige Beispiele haben wir zu Hauf.Weitervererbung von Aussehen und Charaktereigenschaften sind nur bei gezielten Verpaarungen von Rassekatzen zu erreichen. Vor allem deshalb weil hier über Generationen hinweg ein bestimmtes Ziel verfolgt wird. Unsere normalen Hauskatzen verpaaren sich in der Regel mit einem x-beliebigen unkastrierten Artgenossen.</p><h4>Katzen die kastriert sind, werden faul und träge und fangen nicht mehr so viele Mäuse.</h4><p>Kastrierte Katzen werden nur faul und träge, wenn man ihre Ernährung nicht dem geänderten Stoffwechsel anpasst. Kastrierte Katzen müssen nicht mehr herumstreunen auf der Suche nach einem Partner, sich mit Kontrahenten raufen und sich auch nicht um die Jungenaufzucht kümmern, daher haben sie viel mehr Zeit sich dem Mäusefang zu widmen.Allerdings werden Katzen die vorher keine begnadeten Mäusefänger waren auch nachher keine mehr werden. Katzen die hingegen vor der Kastration viele Mäuse gefangen haben, werden dies nach der Kastration genauso intensiv betreiben. Außerdem sollte man bedenken, dass Katzen mit zunehmendem Alter generell ruhiger werden.</p><h4><br>Wenn alle Katzen kastriert werden, gibt es bald keine normalen Hauskatzen mehr.</h4><p>Es wird niemals möglich sein, alle Katzen zu erwischen zumal es immer noch die richtig wilden Hauskatzen gibt, die sich nur nachts sehen lassen und von denen niemand in der Umgebung weiß, dass es sie überhaupt gibt. Es sollte auch bedacht werden, dass viele Tierschutzvereine und Tierheime leider gezwungen sind hochträchtige Streuner kastrieren zu lassen, weil die Babies dieser Katzen absolut keine Chance auf ein vernünftiges zu Hause haben. Die nicht vermittelten Babies würden wichtige Pflegestellen blockieren und so kann verletzten oder kranken Tieren nicht geholfen werden.</p><h4><br>Der Kater/die Katze soll doch auch seinen/ihren Spaß haben</h4><p>Kater streunen kilometerweit um eine rollige Katze zu decken. Sie kämpfen oft mit Rivalen und kommen meist, wenn sie nicht auf ihren Streifzügen dem Autoverkehr oder anderen Feinden zum Opfer gefallen sind, abgemagert und übersäht mit Wunden zurück. Durch diese Kämpfe aber auch durch den Deckakt selber können Krankheiten wie z.B. FIV (auch Katzenaids genannt) übertragen werden und die meisten unkastrierten Katzen haben daher eine relativ niedrige Lebenserwartung. Zudem ist der Deckakt alles andere als ein Vergnügen für die Katze. Auf dem Penis des Katers befinden sich Widerhaken, die beim Herausziehen, der Katze große Schmerzen bereiten und dadurch den Eisprung auslösen. Der Kater zieht sich nach dem Deckakt schnell zurück um keine Prügel zu kassieren. Oben im Bild ein Beispiel eines Katers, wie unkastrierte Kater oft über kurz oder lang aussehen: übersäht von Biss- und Kratzwunden, abgemagert, etc..&nbsp;Die Katze/der Kater ist zu alt für eine Kastration – zahlt sich nicht mehr aus<br>Eine Kastration macht immer Sinn, auch von älteren Tieren. Katzen können bis ins hohe Alter rollig und entsprechend trächtig werden. Alte, potente Kater haben es mit zunehmendem Alter immer schwerer sich gegenüber jüngeren Rivalen durchzusetzen und kassieren umso mehr Prügel und werden verletzt. Das Bild oben zeigt einen Kater aus Hinzenbach, der bei der Kastration mind. 10 Jahre alt war. Das Nachher-Foto wurde etwa ein Jahr nach der Kastration aufgenommen.</p><h4><br>Kater werden kastriert und Katzen sterilisiert</h4><p>Dies ist ein immer noch sehr verbreiteter Irrtum, denn Sterilisation bzw. Kastration definiert nicht ob ein männliches oder weibliches Tier operiert wird. Katzen werden im Regelfall genauso kastriert wie Kater. Kastration bedeutet nämlich das vollständige Entfernen von Hoden bzw. Eierstöcken und je nach Tierarzt bzw. Fortschritt einer ev. Trächtigkeit auch die Entfernung der Gebärmutter. Sterilisation bedeutet jedoch nur, dass die Samenleiter beim Kater bzw. die Eileiter bei der Katze durchtrennt werden. Die Tiere bleiben dabei aber sexuell aktiv. Weibliche Katzen werden weiterhin rollig und auch die Kater streunen wochen- und monatelang durch die Gegen um Katzen zu decken.</p><h4><br>Katzen müssen bei der Kastration 3 kg schwer sein</h4><p>Dieses Gewicht wird durchschnittlich mit 6 - 8 Monaten erreicht. Mit dem Alter sind viele Katzen bereits trächtig bzw. Kater markieren oft schon längst. Natürlich kann man die Kastration auch schon früher dh vor der Geschlechtsreife und vor einer willkürlich bestimmten Gewichtsangabe durchführen. Schließlich können heutzutage bereits auch Nager wie Meerschweinchen, Mäuse und Hamster kastriert werden.</p><h4><br>Geschwister verpaaren sich nie!</h4><p>Großer Irrtum! Dem Kater ist es ziemlich egal, ob die rollige Katze seine Schwester oder Mutter oder sonst wie mit ihm verwandt ist. Der Trieb sagt ihm einfach nur, dass er sich mit der rolligen Katze paaren muss, egal wie eng verwandt sie mit ihm ist. Gerade bei Geschwistern wäre eine Kastration mit spätestens 5 Monaten unbedingt anzuraten!</p><h4><br>Die Katze wird ohnehin nie rollig / bekommt sowieso nie Junge.</h4><p>Hier liegt die Ursache oft darin, dass die Katze entweder bereits Veränderungen an der Gebärmutter hat (Entzündungen, Vereiterung) oder eine Zysten an den Eierstöcken hat. Beides hat über kurz oder lang die Folge, dass die Katze qualvoll daran stirbt. Oft kommt es aber auch vor, dass die Katze unbemerkt trächtig wird (mit nur ein oder 2 Jungen) und dann eine Fehlgeburt hat oder die Kleinen irgendwo zur Welt bringt und nicht versorgt und diese dann sterben.</p>'),
(7, '<p>Katzen und Kater können grundsätzlich ab dem 4ten Lebensmonat kastriert werden. Es gibt auch die Frühkastration, diese wird vor allem in den USA und bei Züchtern, zum Teil aber auch bereits bei Tierschutzorganisationen angewandt. Die Frühkastration wird im Normalfall zwischen der 8ten und 16ten Woche durchgeführt.<br>So kann mit abgegebenen Tieren nicht \"gezüchtet\" werden.</p><p>Das Durchschnittsalter für eine Kastration liegt bei etwa<span>&nbsp;</span><strong>4 - 6 Monaten<span>&nbsp;</span></strong>liegen. Bei verschieden geschlechtlichen<span>&nbsp;</span><strong>Geschwisterpärchen</strong><span>&nbsp;</span>wäre anzuraten, beide mit etwa<strong><span>&nbsp;</span>5 Monaten</strong><span>&nbsp;</span>kastrieren zu lassen.<span>&nbsp;</span><br>Eine Katze muss nicht rollig gewesen sein um sie kastrieren zu lassen und auch Kater müssen noch nicht zu markieren anfangen.<br>Die Gefahr, dass die Kater nach der Kastration weitermarkieren, weil sie es schon so gewohnt sind, ist immer gegeben.<br>Rollige Katzen nerven ihren Besitzer nicht nur mit extremer Anhänglichkeit sondern auch mit ständigem raunzen, miauen. Rollige Katzen werden zudem sehr erfinderisch wenn es darum geht zu einem potenten Kater zu kommen und sind bereits oft genug Katzen aus dem Fenster gesprungen oder aus der Tür entwischt. Man sollte auch bedenken, dass es die sogenannte „stille Rolligkeit“ gibt. Hier zeigt die Katze keinerlei Anzeichen für die Rolligkeit. Der Besitzer merkt also überhaupt nichts davon, sehr wohl aber die Kater in der Umgebung.</p><p>Manche Tierärzte behaupten leider immer noch, dass zu früh kastrierte Kater keinen richtigen Katerkopf bekommen würden oder kleinwüchsig bleiben.<br>Das konnte weder in Studien noch von Seiten der Tierschutzvereine, die öfter gezwungen sind jüngere Tiere zu kastrieren, bestätigt werden.<br>Die Größe der Katzen hängt nicht von den Geschlechtshormonen ab, sondern von den Genen und ist bereits vorgegeben. Egal wann die Kastration stattfindet.<span>&nbsp;</span><br>Bei den verwilderten Katzen kastrieren wir ab 4 Monaten, ganz einfach aus dem Grund, weil wir die Möglichkeit nutzen müssen, falls eine dieser jungen Katzen in die Falle geht. Wenn wir sie freilassen würden um sie später noch einmal zu fangen, könnte es bereits zu spät sein.<span>&nbsp;</span><br>Bislang konnten auch wir keine Unterschiede in der Entwicklung bei etwa 4 Monate alten kastrierten Tieren feststellen.</p>'),
(8, '<h4>Nach der Operation</h4><p>Die Katze sollte unbedingt frei von klinischen Krankheitssymptomen sein. In optimalen Fällen kennt der Tierarzt das Tier von vorangegangenen Untersuchungen im Rahmen von Impfungen und antiparasitären Behandlungen.<br>Unmittelbar vor der Operation darf die Katze nichts fressen, d.h. über einen Zeitraum von 12 Stunden kein Futter zu sich nehmen. Wasser trinken darf sie jedoch sehr wohl.</p><p>Ebenfalls günstiger für die Operationssituation ist, wenn die Katzen nicht gerade rollig ist (erhöhte Blutungsgefahr)<br>Eine Kastration ist natürlich trotzdem möglich. Bisher gab es bei unseren Katzen, welche bei der Kastration rollig waren, keinerlei Komplikationen.</p>'),
(9, '<p><span>Um die jährliche Katzenschwemme wenigstens etwas einzubremsen gibt es seit 1.1.2005 eine Kastrationspflicht welche auch im Tierschutzgesetz verankert ist.</span></p><p>Der Gesetzestext lautet:</p><p><em><strong>„Werden Katzen mit regelmäßigem Zugang ins Freie gehalten, so sind sie von einem Tierarzt kastrieren zu lassen, sofern diese Tiere nicht zur kontrollierten Zucht verwendet werden oder in bäuerlicher Haltung leben.“</strong></em></p><p>Aufgrund der Petition bzgl. der Ausnahme von Katzen in bäuerlicher Haltung die vom Verein „Streunerkatzen OÖ“ eingereicht wurde, nahm im März 09 das Bundesministerium für Gesundheit Stellung: Ausgenommen von der Kastrationspflicht (\"bäuerliche Haltung\") sind lediglich Tiere, die vielleicht zwar regelmäßig auf einem bäuerlichen Hof mitgefüttert werden, aber ansonsten verwildert sind und als Streunertiere leben.<span>&nbsp;</span><strong>Bauern müssen demnach IHRE eigenen Katzen sehr wohl auch kastrieren lassen.</strong><span>&nbsp;</span>Für diese Katzen gelten die gleichen Mindestanforderungen für die Haltung, wie für Katzen von Privatpersonen.</p><p>Die Kastrationspflicht wird von Tierschutzvereinen als auch engagierten Privatpersonen kontrolliert und bei Verstoß zur Anzeige gebracht.<br><strong>Bei Nichteinhaltung der Kastrationspflicht drohen Strafen bis zu € 3.750</strong></p><p><strong>Wichtige Information zum Thema</strong></p><p>Katzen können bereits ab etwa 4 Monaten geschlechtsreif werden.<span>&nbsp;</span><strong>Eine Kastration zwischen dem 4. und 6. Lebensmonat ist daher mittlerweile durchaus üblich.</strong><span>&nbsp;</span>Die Empfehlung, dass eine Katze erst rollig gewesen sein muss, oder ein Kater erst zu markieren angefangen haben muss, um eine Kastration durchzuführen zu können ist längst überholt und veraltet.</p><p>Personen die gerne \"einmal Babies\" hätten oder das Aufwachsen der Kleinen beobachten möchten, sollten sich<span>&nbsp;</span><strong>ausführlich</strong><span>&nbsp;</span>über Trächtigkeit, Geburt und Aufzucht informieren und sich dann an einen Tierschutzverein oder Tierheim wenden. Es gibt leider genug hochträchtige Katzen, die nicht mehr kastriert werden können und die ohnehin Babies bekommen. Tierschutzvereine und Tierheime würden durch Unterbringung solcher Katzen auf verantwortungsbewussten und verlässlichen Pflegeplätzen immens entlastet werden.</p>'),
(10, '<p>content zur streunerkatzen page</p>'),
