(15, '<p>TODO restrukturieren</p><table cellspacing=\"6\" width=\"100%\" align=\"center\">\n<tbody>\n<tr>\n<td class=\"us2\" colspan=\"4\">Gesamtstatistik von 17.08.2006 bis 31.12.2012</td>\n</tr>\n<tr>\n<td class=\"textz\" colspan=\"4\">&nbsp;</td>\n</tr>\n<tr>\n<td class=\"text\" width=\"222\"><strong>Gesamtzahl Kastrationen:</strong></td>\n<td class=\"text\" width=\"142\"><strong>991</strong></td>\n<td class=\"text\" width=\"196\">&nbsp;</td>\n<td class=\"text\" width=\"161\">&nbsp;</td>\n</tr>\n<tr>\n<td class=\"text\" height=\"18\">davon weiblich:</td>\n<td class=\"text\">852</td>\n<td class=\"text\">davon trächtige Katzen:</td>\n<td class=\"text\">75</td>\n</tr>\n<tr>\n<td class=\"text\">davon männlich:</td>\n<td class=\"text\">409</td>\n<td class=\"text\">davon mit Hodenhochstand:</td>\n<td class=\"text\">8</td>\n</tr>\n<tr>\n<td class=\"text\">bei der OP gestorben:</td>\n<td class=\"text\">1 Katze, 3 Kater</td>\n<td class=\"text\">&nbsp;</td>\n<td class=\"text\">&nbsp;</td>\n</tr>\n<tr>\n<td class=\"textz\" colspan=\"4\">&nbsp;</td>\n</tr>\n<tr>\n<td class=\"text\"><strong>durch Bauernhofaktion kastriert:</strong></td>\n<td class=\"text\">361</td>\n<td class=\"text\">teilnehmende Betriebe:</td>\n<td class=\"text\">45</td>\n</tr>\n<tr>\n<td class=\"text\">kastrierte Katzen:</td>\n<td class=\"text\">220</td>\n<td class=\"text\">davon trächtige Katzen:</td>\n<td class=\"text\">24</td>\n</tr>\n<tr>\n<td class=\"text\">kastrierte Kater:</td>\n<td class=\"text\">141</td>\n<td class=\"text\">scheue Katzen vermittelt:</td>\n<td class=\"text\">29</td>\n</tr>\n</tbody>\n</table>'),
