(18, '<p>Da wir die eingefangenen Katzen nicht nur kastrieren lassen, sondern auch ev. Krankheiten oder Verletzungen behandeln lassen, sind natürlich auch einige Tierarztrechnungen zu bezahlen. Aber auch für Futter, Katzenstreu, Werbemittel, etc benötigen wir immer wieder finanzielle Unterstützung.</p><h4>Vereinskonto Streunerkatzen OÖ</h4><p>Sparda Bank<br>Kto: 24100670000<br>BLZ: 49460</p><p>für Überweisungen aus dem Ausland:</p><p><strong>IBAN</strong>: AT694946000002410067<br><strong>SWIFT</strong>: SPDAAT21XXX<br> <br><strong>Paypal</strong>: info@streunerkatzen.org<br> <br>Vielen Dank für Ihre Spende!</p>'),
(19, '<p>todo: restrukturierung</p><p>SachspendenSachspenden&nbsp;Hier finden Sie Dinge, die wir immer brauchen können, vielleicht haben Sie ja das eine oder andere zu Hause oder Sie können das eine oder andere auch über einen unserer Partnerlinks bestellen. Somit helfen Sie uns gleich doppelt.<br>&nbsp;Kontakt: Sabine Auer, 0699 / 11 91 01 54Sachspenden können auch direkt an unsere Vereinsadresse geschickt werden&nbsp;Katzen&nbsp; Futter - vorzugsweise NassfutterHier nehmen wir gerne auch sehr günstiges Futter wie z.b. Felix, Shah, Cassedy, Dein Bestes, Molly, .. (z.B. bei zooplus.de speziell für unsere Wilden, wo es nur darum geht die hungernden Mäulchen zu stopfen&nbsp; zum päppelnda wir immer wieder abgemagerte/kranke Katzen bei uns zum Päppeln haben, brauchen diese natürlich etwas hochwertigeres um schnell etwas auf die Rippen zu kriegen. Hierfür eignen sich hochwertige Futtermarken und Flüssignahrung wie:Royal Canin Recovery (Flüssignahrung, erhältlich beim Tierarzt)Royal Canin Convalescence Support (Flüssignahrung in pulverform, erhältlich beim Tierarzt)Calopet Paste (bei manchen Tierärzten und Apotheken bzw. Online-Shops erhältlich)&nbsp;Animonda, Grau, Bozita, ... (z.B. bei zooplus.de erhältlich)Aufzuchtsmilch (vorzugsweise Gimpet)&nbsp; MedikamenteWir haben auch immer wieder verletzte und kranke Katzen bei uns, für diese benötigen wir fast immer:Refobacin Augensalbe / Augentropfen (bitte nur neu und nicht abgelaufen)Accular (Augentropfen)Aqua Tears (Augentropfen)KäspappelteeMilbemax (Entwurmungstabletten, f. Katzen u. kleine Katzen)Drontal (Entwurmungstabletten)Advocate (Flohmittel)Frontline spot on (Flohmittel)Surolan (Ohrenreiniger)&nbsp; Decken und alte Handtücherkönnen ruhig Löcher haben, werden nur zum notürftigen Auspolstern der vorübergehenden Unterschlüpfe verwendet<br>&nbsp; Katzenstreuvon uns bevorzugte Streu ist die Cat´s Best Öko Plus, da sie ist sehr sparsam im Verbrauch ist und man mit einem Sack sehr lange auskommt.<br>&nbsp;Baumaterialien (für Unterschlüpfe)&nbsp; ausgediente Hängekästchen oder Hundehüttendiese werden von uns zu trockenen und halbwegs warmen Unterschlüpfen für die verwilderten Katzen umgebaut<br>&nbsp; Styroporzum dämmen der Hängekästchen und Hundehütten<br>&nbsp; wasserfeste Folie und Lackedienen dazu um die Unterkünfte wasserdicht und trocken zu gestalten<br>&nbsp;Reinigungsmittel&nbsp; Waschmittel (Pulver u. flüssig)da wir immer wieder Pfleglinge zum gesundpflegen oder auch trächtige Katzen aufnehmen, müssen die Unterlagen und Kuschelhöhlen regelmässig gewaschen werden um eine Ausbreitung von Krankheiten zu verhindern.<br>&nbsp; PutzmittelNatürlich müssen Boden, aber auch Futterschüsseln und Transporter immer wieder gereinigt werden. Daher nehmen wir auch immer wieder gerne:GeschirrspülmittelBodenreiniger&nbsp;ATTA&nbsp;&nbsp; Desinfektionsmittelist besonders bei unseren kranken Pfleglingen wichtig&nbsp;&nbsp;Sonstiges&nbsp; Papier, weiß und buntfür Ausdrucke von Aushängen, Flyern, Broschüren, Schreiben, etc..&nbsp;&nbsp; Toner&nbsp;für Farblaserdrucker Canon i-sensys LBP5000&nbsp; Briefmarken&nbsp; Tankgutscheine</p>'),
(20, '<p>TODO: restrukturierung</p><p>Eine weitere Möglichkeit uns zu unterstützen gibt auf verschiedenen Webseiten. Hier erhalten wir Pro Klick oder pro Einkauf finanzielle Unterstützung.Eine weitere Möglichkeit uns zu unterstützen gibt auf verschiedenen Webseiten. Hier erhalten wir Pro Klick oder pro Einkauf finanzielle Unterstützung.<br>&nbsp;&nbsp;Qualität für Katze und Hund Pro gültig abgeschlossener Bestellung erhalten wir 5,5 % des Bestellwertes.Angeboten werden Artikel für Katze und Hund aus den Bereichen Spielzeug, Training, Transport, Premiumnahrung und Nahrungsergänzung, Aufzucht- und Medizinbedarf bis hin zu Bachblüten, Trinkbrunnen und Profi-Pflegeartikeln.&nbsp;&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Für Bestellungen über den links angeführten Link erhalten wir 4 % des Nettoumsatzes aller Artikel, die über diesen Link gekauft wurden.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; Für Bestellungen über den links angeführten Link erhalten wir 5 % des Nettoumsatzes aller Artikel, die über diesen Link gekauft wurden. Ab 11 Artikel erhalten wir 5,25 %&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;&nbsp;Weinshop mit persönlichem Weinetikett Pro Bestellung erhalten wir hier 10 % Provision.Wein aus Österreich mit individuell gestaltbarer Etikette.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;www.fressnapf.de Für die Anmeldung über den links angeführten Link erhalten wir 1000 Tatzen gutgeschrieben.Weiters kann man seine Tatzen, die man gesammelt hat (durch Einrichten einer Seite, Beiträge im Forum, etc..) einem Tierheim oder Verein spenden.Spenden an Vereine und Tierheime werden grundsätzlich in fünffacher Höhe auf dem Tatzenkonto gutgeschrieben.Wir haben dann die Möglichkeit die Tatzen gegen einen Gutschein einzutauschen um diesen dann in einem der Freßnapfmärkte einzulösen.Info: 10 Tatzen haben einen Wert von 1 Cent<br>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; Für jeden Amazon.de Geschenkgutschein, den wir vermitteln, verdienen wir pauschal 6% vom jeweiligen Gutscheinwert. Die Werbekostenerstattung wird vergütet für Verkäufe, die direkt über Geschenkgutschein-Links von unserer Webseite generiert werden UND über Geschenkgutscheine, die nach dem Anklicken von anderen Amazon.de Produkten gekauft wurden.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; Für jeden Amazon.de DVD-Verleih - Neukunden erhalten wir 12 EUR Prämie.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br>www.&nbsp;GO!Domain, Webspace, www.sprit.orgPro Abfrage bekommen wir 5 Cent gutgeschrieben. Aus Sicherheitsgründen werden nur unterschiedliche (unique) IP-Adressen als Klick gewertet.&nbsp;(Link lässt sich leider nicht in einem neuen Fenster öffnen :-( , aber wir arbeiten daran)&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; Beim Abonnieren der Zeitschrift \"Herz für Tiere\", \"Geliebte Katze\", \"Partner Hund\" oder \"Aquarium live\" über links angeführten Link erhalten wir pro abgeschlossenem Abo eine Provision von 15 % des Nettopreises.</p>'),
