nn man seine Tatzen, die man gesammelt hat (durch Einrichten einer Seite, Beiträge im Forum, etc..) einem Tierheim oder Verein spenden.Spenden an Vereine und Tierheime werden grundsätzlich in fünffacher Höhe auf dem Tatzenkonto gutgeschrieben.Wir haben dann die Möglichkeit die Tatzen gegen einen Gutschein einzutauschen um diesen dann in einem der Freßnapfmärkte einzulösen.Info: 10 Tatzen haben einen Wert von 1 Cent<br>&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; Für jeden Amazon.de Geschenkgutschein, den wir vermitteln, verdienen wir pauschal 6% vom jeweiligen Gutscheinwert. Die Werbekostenerstattung wird vergütet für Verkäufe, die direkt über Geschenkgutschein-Links von unserer Webseite generiert werden UND über Geschenkgutscheine, die nach dem Anklicken von anderen Amazon.de Produkten gekauft wurden.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; Für jeden Amazon.de DVD-Verleih - Neukunden erhalten wir 12 EUR Prämie.&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<br>www.&nbsp;GO!Domain, Webspace, www.sprit.orgPro Abfrage bekommen wir 5 Cent gutgeschrieben. Aus Sicherheitsgründen werden nur unterschiedliche (unique) IP-Adressen als Klick gewertet.&nbsp;(Link lässt sich leider nicht in einem neuen Fenster öffnen :-( , aber wir arbeiten daran)&nbsp;&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp; Beim Abonnieren der Zeitschrift \"Herz für Tiere\", \"Geliebte Katze\", \"Partner Hund\" oder \"Aquarium live\" über links angeführten Link erhalten wir pro abgeschlossenem Abo eine Provision von 15 % des Nettopreises.</p>'),
(22, '<p>TODO: formular mitgliedschaft</p><p><strong>Hinweise bzgl. Mitgliedschaft:</strong></p><p>(*) Ordentliche Mitglieder sind jene, die sich voll an der Vereinsarbeit beteiligen und/oder sich mit den Zielen des Vereines identifizieren können. Ordentliche Mitglieder können alle Personen nach Vollendung des 14. Lebensjahres oder juristische Personen sein, bei Minderjährigen ist zusätzlich die Unterschrift des gesetzlichen Vertreters erforderlich.<br><br>(**) Wir planen die Gründung einer Jugendgruppe: Ziel soll sein gerade Kinder und Jugendliche für das Problem der unkastrierten Katzen zu sensibilisieren.</p><p><strong>Zahlung Mitgliedsbeitrag:</strong><br>Späteste Zahlungsfrist für den Mitgliedsbeitrag ist der 31. Jänner eines jeden Geschäftsjahres.</p><p><strong>Austritt aus dem Verein:</strong><br>Der Austritt kann nur zum 31. Dezember jeden Jahres erfolgen. Er muss dem Vorstand mind. 2 Monate vorher schriftlich mitgeteilt werden. Erfolgt die Anzeige verspätet, so ist sie erst zum nächsten Austrittstermin wirksam. Für die Rechtzeitigkeit ist das Datum der Postaufgabe maßgeblich.</p>'),
(23, '<p>TODO Patenschaft formular</p><p>&nbsp;</p><p>Mit einer Patenschaft unterstützen Sie die Finanzierung von Kastrationen und tierärztlichen Behandlungen von verwilderten Katzen.<br>Als Pate können Sie sich jederzeit bei uns melden um ein oder auch mehrmals zu einer Fangaktion mitzukommen um sich vor Ort ansehen zu können, was Sie mit ihrem Beitrag unterstützen.</p>'),
(24, '<p>Leider gibt es sehr viele mehr oder weniger große verwilderte Katzenpopulationen. Wir versuchen so gut als möglich diese Populationen in Schach zu halten bzw. das Vergrößern dieser Populationen mittels Kastrationen zu verhindern.Leider gibt es sehr viele mehr oder weniger große verwilderte Katzenpopulationen. Wir versuchen so gut als möglich diese Populationen in Schach zu halten bzw. das Vergrößern dieser Populationen mittels Kastrationen zu verhindern.</p><p>Einige der Katzen können jedoch nicht wieder an ihre angestammten Plätze zurück, weil sie entweder unerwünscht oder dort in Gefahr sind.</p><p>Daher suchen wir dringend Bauernhöfe, Reitställe, Schrebergärtenbesitzer, Privatpersonen mit Haus und Garten, etc.., die mind. 2 scheue Katzen aufnehmen können.</p><p>Die Katzen bräuchten nur:</p><ul>\n<li>1 x täglich gefüttert werden</li>\n<li>einen trockenen Unterschlupf (entweder eine Scheune, Kellerraum, Gartenhäuschen, etc...)</li>\n</ul><p><strong>Die Katzen werden kastriert, augenscheinlich gesund und kostenlos bzw. gegen eine kleine Spende abgegeben.</strong></p><p>Die Katzen werden gebracht. Für die ersten Wochen empfiehlt es sich, wenn diese Katzen in einem geschlossenen Raum (Gartenhütte, Garage, Keller, etc..) untergebracht werden um sich an die neue Umgebung und die neue Futterstelle zu gewöhnen.</p><p>Wenn Sie interessiert sind, dann wenden Sie sich bitte an Sabine Auer, 0699 / 11 91 01 54</p>'),
(25, '<p>TODO: Blogartikel zu Kategorien</p><ul>\n<li>Berichte / Fangen</li>\n<li>Infoecke (zur Katzenhaltung, ...)</li>\n<li>Schicksale</li>\n<li>Was tun, wenn...</li>\n<li>Veranstaltungen</li>\n</ul>'),
(27, '<p>Sämtliche Inhalte, Fotos, Bilder, Texte oder Layout dieser Webseiten sind urheberrechtlich geschützt. Es ist untersagt, diese ohne ausdrückliche Genehmigung von Sabine Auer zu kopieren oder auf andere Weise zu verbreiten. <br>Copyright © 2004 - 2019 Sabine Auer. All rights reserved.</p>'),
